import React, { useState } from 'react'
import { AiOutlineEye, AiOutlineEyeInvisible} from "react-icons/ai";
import {toast} from "react-hot-toast";
import { useNavigate } from "react-router-dom";
const Signupform = ({setIsLoggedIn}) => {
    const navigate = useNavigate();
    const[formData, setFormData] = useState({
        firstname:"",
        lastname:"",
        email:"",
        password:"",
        confirmPassword:""
    });
    function changeHandler(event){
        setFormData((prevdata) => ({
             ...prevdata,
             [event.target.name] : event.target.value 
        }));
    }
    const[showPassword,setShowPassword] = useState(false);
    const[showPassword1,setShowPassword1] = useState(false);
    function submitHandler(event){
        event.preventDefault();
        if(formData.password != formData.confirmPassword){
            toast.error("Passwords do not match");
        }
        else{
            setIsLoggedIn(true);
            toast.success("Account Created");
            navigate("/dashboards");
        }
    }
  return (
    <div>
        <div className='flex bg-richblack-800 p-1 gap-z-1 my-6 rounded'>
            <button>Student</button>
            <button>Instructor</button>
        </div>
        <form onSubmit={submitHandler} className='flex flex-col gap-y-4'>
            <div className='flex w-full justify-between'>
                <label>
                    <p className='text-[0.875rem] text-richblack-5 mb-1 leading-[1.375rem]'>First Name<sup className='text-pink-200'>*</sup></p>
                    <input
                        required
                        type='text'
                        name='firstname'
                        onChange={changeHandler}
                        placeholder='Enter First Name'
                        value={formData.firstname}
                        className='bg-richblack-800 rounded-[0.5rem] text-richblack-5 w-full p-[12px]'
                    />
                </label>
                <label>
                    <p className='text-[0.875rem] text-richblack-5 mb-1 leading-[1.375rem]'>Last Name<sup className='text-pink-200'>*</sup></p>
                    <input
                        required
                        type='text'
                        name='lastname'
                        onChange={changeHandler}
                        placeholder='Enter Last Name'
                        value={formData.lastname}
                        className='bg-richblack-800 rounded-[0.5rem] text-richblack-5 w-full p-[12px]'
                    />
                </label>
            </div>
            <label className='w-full'>
                    <p className='text-[0.875rem] text-richblack-5 mb-1 leading-[1.375rem]'>Email Address<sup className='text-pink-200'>*</sup></p>
                    <input
                        required
                        type='email'
                        name='email'
                        onChange={changeHandler}
                        placeholder='Enter Email Address'
                        value={formData.email}
                        className='bg-richblack-800 rounded-[0.5rem] text-richblack-5 w-full p-[12px]'
                    />
            </label>
            <div className='flex w-full justify-between'>
                <label className='relative'>
                    <p className='text-[0.875rem] text-richblack-5 mb-1 leading-[1.375rem]'>Create Password<sup className='text-pink-200'>*</sup></p>
                    <input
                        required
                        type={showPassword ? ("text") : ("password")}
                        name='password'
                        onChange={changeHandler}
                        placeholder='Enter Password'
                        value={formData.password}
                        className='bg-richblack-800 rounded-[0.5rem] text-richblack-5 w-full p-[12px]'
                    />
                     <span className='absolute right-3 top-[38px] cursor-pointer ' onClick={() => {setShowPassword((prev) => !prev)}}>{showPassword ? (<AiOutlineEyeInvisible fontSize={24} fill='#AFB2BF'/>) : (<AiOutlineEye fontSize={24} fill='#AFB2BF'/>)}</span>
                </label>
                <label className='relative'>
                    <p className='text-[0.875rem] text-richblack-5 mb-1 leading-[1.375rem]'>Confirm Password<sup className='text-pink-200'>*</sup></p>
                    <input
                        required
                        type={showPassword1? ("text") : ("password")}
                        name='confirmPassword'
                        onChange={changeHandler}
                        placeholder='Confirm Password'
                        value={formData.confirmPassword}
                        className='bg-richblack-800 rounded-[0.5rem] text-richblack-5 w-full p-[12px]'
                    />
                     <span className='absolute right-3 top-[38px] cursor-pointer ' onClick={() => {setShowPassword1((prev) => !prev)}}>{showPassword1 ? (<AiOutlineEyeInvisible fontSize={24} fill='#AFB2BF'/>) : (<AiOutlineEye fontSize={24} fill='#AFB2BF'/>)}</span>
                </label>
            </div>
            <button className='bg-yellow-50 rounded-[8px] font-medium text-richblack-900 px-[12px] py-[8px] w-full'>Create Account</button>
        </form>
    </div>
  )
}

export default Signupform;
